import React from 'react';

const CompanyDetails = ({ onChange }) => {
    return (
        <div className="card mb-3">
            <div className="card-body">
                <h5 className="card-title">Step 2: Company Details</h5>
                <form>
                    <div className="form-group">
                        <label htmlFor="customerCompany">Customer Company</label>
                        <input type="text" className="form-control" id="customerCompany" onChange={(e) => onChange('customerCompany', e.target.value)} />
                    </div>
                    <div className="form-group">
                        <label htmlFor="performerCompany">Performer Company</label>
                        <input type="text" className="form-control" id="performerCompany" onChange={(e) => onChange('performerCompany', e.target.value)} />
                    </div>
                </form>
            </div>
        </div>
    );
};

export default CompanyDetails;
